  false,\n\t\"url\": null,\n\t\"notes\": \"This plan will provide the guidance to
  move the current Modoc NWR farming program into a new program which is more in line
  with biological farming techniques. This plan is designed to increase the intensity
  of management on a smaller land base with the intent of providing a more consistent
  level of grain production from year to year. This will also allow a less intense
  program to be applied to the remaining acreage.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
